import styles from './Presentation.module.css'
function Presentation(){
    return(
        <div id='Presentation' className={styles.presentation}>
            <p><strong>Bem-vindo ao meu Portfólio</strong></p>
            <h1>Olá, eu sou o Mateus Simões!</h1>
            <p>Sou estudante de programação no curso de Tecnologia da Escola DNC, em busca de migração para a área de desenvolvimento.
Autodidata e curioso por hobby, sempre em busca de desafios que possam me desenvolver profissional e pessoalmente e que possibilitem deixar minha marca registrada no mundo, ou por onde eu passar.
</p>
        </div>
    )
}

export default Presentation
